import React from "react";
import "./index.scss";
import { connect } from "react-redux";
import { bindActionCreators } from "redux";
import {
  getDataProduct,
  getProductFilter,
  getArrayFilter,
} from "../../redux/action";

class FilterPage extends React.Component {
  componentDidMount() {
    this.props.getArrayFilter(this.props.query);
  }

  render() {
    return (
      <div className="FilterPage-wraper">
        <div className="FilterPage-wraper-left">
          {this.props.defaultTerm && (
            <div
              className="FilterPage-wraper-left-container-GeneralTerm"
              id="aaccordion"
            >
              {this.props.defaultTerm.map((ele, index) => (
                <div className="DefaultTerm">
                  <div class="card">
                    <div class="card-header">
                      <a
                        class="card-link"
                        data-toggle="collapse"
                        href="#collapseOne"
                      >
                        {ele.attribute_name}
                      </a>
                    </div>
                    <div id="collapseOne" class="collapse show">
                      <div class="card-body ">
                        {this.props.defaultTerm[index].attribute_value.map(
                          (ele, index) => (
                            <div className="form-check-inline ">
                              <label className="form-check-label">
                                <input
                                  type="checkbox"
                                  className="form-check-input"
                                />
                                {ele.option_name}
                              </label>
                            </div>
                          )
                        )}
                      </div>
                    </div>
                  </div>
                </div>
              ))}
            </div>
          )}
        </div>
        <div className="FilterPage-wraper-right">
          {this.props.generalTerm_PositionTop && (
            <div className="FilterPage-wraper-right-container-PositionTop">
              {this.props.generalTerm_PositionTop.map((ele, index) =>
                index === 0 ? (
                  <div className="form-check-inline PositionTop">
                    <label className="form-check-label">
                      <input type="checkbox" className="form-check-input" />
                      <img src={ele.attribute_img} alt="isEvent" />
                    </label>
                  </div>
                ) : (
                  <div className="form-check-inline PositionTop">
                    <label className="form-check-label">
                      <input type="checkbox" className="form-check-input" />
                      {ele.attribute_name}
                    </label>
                  </div>
                )
              )}
            </div>
          )}
        </div>
      </div>
    );
  }
}

const mapsStateToProps = (state) => ({
  defaultTerm: state.defaultTerm,
  generalTerm: state.generalTerm,
  generalTerm_PositionTop: state.generalTerm_PositionTop,
});

const mapDispatchToProps = (dispatch) => ({
  ...bindActionCreators(
    {
      getDataProduct,
      getProductFilter,
      getArrayFilter,
    },
    dispatch
  ),
});
export default connect(mapsStateToProps, mapDispatchToProps)(FilterPage);
